import React from 'react';
import CardList from './CardList';
import Searchbox from './Searchbox';
import { pets } from './pets';

class App extends React.Component {
	render() {
		return (
			<div className="tc">
				<h1>Pinder</h1>
				<Searchbox />
				<CardList pets={pets} />
			</div>
		);
	}
}

export default App;
